  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Muscatatuck
  NWR outlines Refuge accomplishments during the 1988 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. The report includes
  a planning section which discusses the master plan. Refuge administration is outlined;
  information about personnel, funding, safety, and technical assistance is given.
  Habitat management is also covered; subjects include wetlands, forests, and croplands.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, and marking and bird banding. The public uses
  of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, major maintenance, equipment replacement, communication systems, and
  energy conservation. Refuge brochures are attached.\",\n\t\"license_title\": \"License
